(1, 'fr', 'fas fa-info-circle', 'Nous contacter', 'nous-contacter', NULL, NULL, '<br>', 0, NULL, NULL, '2021-01-04 21:11:14', '2022-01-03 21:49:33'),
(2, 'fr', 'fas fa-info-circle', 'À propos de nous', 'about-us', NULL, NULL, '<div>Suguffiè (Marché en Bambara) est le plus grand site de petites annonces au monde, avec des millions d’annonces de voitures, d’emplois, d’immobilier et autres biens et services affichées présentement. Deux nouvelles annonces sont publiées chaque seconde! Nous sommes fiers de fournir un service qui rassemble le monde et les aide à acheter des articles de qualité dans leur région, faire de l’argent avec leurs items non utilisés et diminuer le gaspillage au pays.<br></div><div>Pas étonnant, nous nous faisons un point d’honneur d’aider le monde à partager des articles de qualité auprès de leurs communautés. En se débarrassant tout en simplicité d’objets dont ils n’ont plus besoin, ils ne font pas que de gagner de l’argent, ils contribuent également à contrer le gaspillage!</div><div><br></div><div>L’idée était de rassembler les Canadiens en leur offrant une façon simple et efficace de vendre, acheter et échanger des articles, des véhicules, des services, de l’immobilier ou du travail. Non seulement ce désir n’a jamais changé, mais nous sommes maintenant implantés dans plus d’une centaine de communautés d’est en ouest du pays!</div><div><br></div><div>Suguffiè est donc un moyen agréable et écoresponsable de recycler des articles au sein de sa communauté, tout en pouvant toujours regarder et tester les articles avant de les acheter.</div><div><br></div><div>Nous contacter</div><div>Vous trouvez qu’il manque quelque chose sur Suguffiè? Vous aimeriez nous dire que votre communauté n’est pas desservie par Suguffiè? Ou vous avez simplement besoin de l’assistance de notre service à la clientèle? Contactez-nous</div><a href=\"mailto:contact@suguffie.com\" style=\"color:white\"><a target=\"_blank\" href=\"mailto:contact@suguffie.com\" style=\"color:white\"><i class=\"fas fa-envelope fa-5x\"></i></a>', 1, NULL, NULL, '2021-01-04 21:12:00', '2021-06-15 22:31:24'),
(3, 'en', 'fas fa-balance-scale', 'Posting Policies', 'posting-policies', NULL, NULL, '<div>The following activities are prohibited from Suguffiè:</div><div>&nbsp;</div><div>Posting an item for sale that is illegal to own, buy or sell in your area of residence.</div><div>Posting an item for sale that is in the prohibited items and services list.</div><div>Posting ads using multiple different email addresses.</div><div>Posting an ad that serves no other purpose other than to send traffic to a web site.</div><div>Posting an ad that violates Suguffiè\'s Jobs Code of Conduct.</div><div>Posting an ad containing a list of keywords not directly related to the item being sold.</div><div>Posting an ad that contains adult, mature or erotic content. Personals are not allowed.</div><div>Posting an ad that defames anyone or contains \"hate speech\".</div><div>Posting opinions, notices, and discussion topics which should instead be posted on social media sites.</div><div>Posting an ad in an incorrect or misleading category or with misleading information.</div><div>Posting an ad that violates Suguffiè\'s Pet Posting Policies.</div><div>Posting an ad that violates Suguffiè\'s Equality in Housing policy.</div><div>Posting as a Private Seller, Owner, or Individual when you are a Business, Dealer or Professional.</div><div>&nbsp;</div><div>Please note:</div><div><br></div><div>Users must be at least 16 years old to post ads on their own. Ads for our younger users must be posted by an adult for security reasons.</div><div>Any ads that do not comply with Suguffiè policies may be removed from the site. Additionally, users who violate such policies may be blocked from using Suguffiè in the future.</div><div>We may, at any time, remove an ad if we believe it interferes with the well-being of the community or the spirit of Suguffiè.&nbsp;</div><div>Our general rule is that you may not list, buy or sell items or services that are illegal to own, buy or sell in your region of residence, or that are not bought or sold in compliance with applicable laws and regulations. You are responsible for ensuring compliance with all applicable laws relating to the item you list, buy or sell.</div>', 1, NULL, NULL, '2021-01-04 21:14:31', '2021-01-26 04:23:04'),
(4, 'fr', 'fas fa-balance-scale', 'Politiques d\'affichage', 'posting-policies', NULL, NULL, '<div>Les activités suivantes sont interdites à Suguffiè:</div><div>&nbsp;</div><div>Publier un article à vendre dont la possession, l\'achat ou la vente est illégal dans votre région de résidence.</div><div>Publier un article en vente dans la liste des articles et services interdits.</div><div>Publier des annonces en utilisant plusieurs adresses e-mail différentes.</div><div>Publier une annonce qui ne sert à rien d\'autre que d\'envoyer du trafic vers un site Web.</div><div>Publier une annonce qui enfreint le code de conduite de Suguffiè.</div><div>Publier une annonce contenant une liste de mots clés non directement liés à l\'article vendu.</div><div>Publier une annonce contenant un contenu réservé aux adultes, mature ou érotique. Les rencontres ne sont pas autorisées.</div><div>Publier une annonce diffamant qui que ce soit ou contenant un \"discours de haine\".</div><div>Publier des opinions, des avis et des sujets de discussion qui devraient plutôt être publiés sur les sites de médias sociaux.</div><div>Publier une annonce dans une catégorie incorrecte ou trompeuse ou avec des informations trompeuses.</div><div>Publier une annonce qui enfreint les politiques d\'affichage d\'animaux de compagnie de Suguffiè.</div><div>Publier une annonce qui viole la politique d\'égalité dans le logement de Suguffiè.</div><div>Publication en tant que vendeur privé, propriétaire ou particulier lorsque vous êtes une entreprise, un concessionnaire ou un professionnel.</div><div>&nbsp;</div><div>Notez s\'il vous plaît:</div><div><br></div><div>Les utilisateurs doivent avoir au moins 16 ans pour publier eux-mêmes des annonces. Les publicités destinées à nos jeunes utilisateurs doivent être publiées par un adulte pour des raisons de sécurité.</div><div>Toute publicité non conforme aux politiques de Suguffiè peut être supprimée du site. De plus, les utilisateurs qui enfreignent ces politiques peuvent être empêchés d\'utiliser Suguffiè à l\'avenir.</div><div>Nous pouvons, à tout moment, supprimer une annonce si nous estimons qu\'elle interfère avec le bien-être de la communauté ou l\'esprit de Suguffiè.</div><div>Notre règle générale est que vous ne pouvez pas lister, acheter ou vendre des articles ou des services dont la possession, l\'achat ou la vente est illégale dans votre région de résidence, ou qui ne sont pas achetés ou vendus conformément aux lois et réglementations applicables. Vous êtes responsable de vous assurer du respect de toutes les lois applicables relatives à l\'article que vous mettez en vente, achetez ou vendez.</div>', 1, NULL, NULL, '2021-01-04 21:19:57', '2021-01-26 04:23:04'),
(5, 'en', 'fas fa-ban', 'Prohibited Content', 'prohibited-content', NULL, NULL, '<div>The list below details what can\'t be posted on Suguffiè:</div><div><br></div><div>Adult</div><div>- Including pornography, nude photos, videos, articles, or erotic products</div><div>- Including prostitution, escort, or accompanying services</div><div>Alcohol</div><div>- Including the delivery of alcohol and related beverages Jobs category.</div><div>Baby Items Deemed Unsafe</div><div>- Baby Nests</div><div>- Baby Walkers</div><div>- Car Seats and Booster Seats manufactured prior to January 1st, 2012</div><div>- Inclined Sleepers (recalled or not)</div><div>- Traditional Drop-Side Cribs</div><div>Blood, Bodily Fluids, and Body Parts</div><div>- Including organs</div><div>- Including surrogacy, fertility, and donor requests (including sperm)</div><div>Burglary Tools</div><div>Cannabis and Cannabis-based Products</div><div>- Including extracts, edibles, and oils</div><div>- Note: Hookahs, pipes, bongs, and vaporizers are permitted.</div><div>- Click here for more details on our cannabis product policies</div><div>Child Adoption services (seeking and offering)</div><div>Combustible Items (including flares)</div><div>- Note: Emergency and distress flares are permitted only if they are designed and intended for signaling purposes.</div><div>- Note: No offers of shipping.</div><div>Counterfeit Items and Distribution of Copyrighted Material</div><div>- Including currency, stamps, and coins</div><div>- Including e-books</div><div>COVID-19 Associated Listings</div><div>- health care masks including N95/N100 and surgical masks</div><div>- hand sanitizer/gel</div><div>- disinfecting wipes</div><div>- toilet paper</div><div>- any listing that mentions COVID-19, coronavirus, or 2019nCoV (except books) in the title or description</div><div>Digital Items or Accounts</div><div>- Including gaming accounts, accounts with multiple device allowances, and digital copies of movies, books, or software</div><div>- Click here for more details on our digital items and accounts policy</div><div>Embargoed Goods</div><div>Event Tickets</div><div>- Note: Certain community events tickets are permitted.</div><div>- Click here for more details on our event ticket sales policy</div><div>Government Issued IDs, Badges, Uniforms and Licenses</div><div>- Including transit, military, police, postal, etc.</div><div>Hazardous Materials</div><div>- Including chemicals, restricted, suspended or cancelled pest control products, and fireworks</div><div>High-Powered Laser Pointers</div><div>Identity Documents, Personal Financial Records, and Personal Information</div><div>- In any form, including mailing lists</div><div>Illegal Drugs and Drug Paraphernalia (or any mention of related items or activities)</div><div>- Including narcotics, steroids, etc.</div><div>Illegal Items and Services</div><div>- Including any device that is primarily useful for the covert interception of private communications</div><div>- Including listings or products that promote the use of photographic devices to covertly view or record individuals for sexual purposes</div><div>Illegal or Unauthorized Wildlife Products</div><div>- Including bear traps (regardless of size)</div><div>Ivory or Bone</div><div>- Including fossilized mammoth tusks</div><div>- Note: Antiques that contain 5% or less of real ivory and were made before the year 1900, specifically musical instruments and furniture, are permitted. The year the item was manufactured as well as an image must be included in the ad.</div><div>- Note: Bone, including fossilized teeth or bone, from non-ivory producing animals is permitted. The species must be indicated in the ad.</div><div>Knives</div><div>- Note: Collectable knives and swords (unsharpened, fantasy/antique) and kitchen utensils and cutlery are permitted.</div><div>Lottery Tickets, Sweepstakes Entries, and Coin Operated Slot Machines</div><div>Massage Services</div><div>- Ad images are to be limited to head shots or photographs of the facility (no full body images)</div><div>- Note: Ads posted by a Registered Massage Therapist (RMT) who is able to provide insurance receipts for customers is permitted.</div><div>- Note: Massage as part of an aesthetics package by a registered Aesthetician, but not offered on its own, is permitted.</div><div>Offensive and Obscene Material</div><div>- Including Nazi related artifacts and collectibles</div><div>- Note: This excludes stamps, letters, and envelopes with the Nazi symbol, currency issued by the Nazi government, military scripts, and historically accurate WWII military model kits that have Nazi symbols.</div><div>Prescription Drugs and Devices</div><div>- Note: Continuous Positive Airway Pressure (CPAP), Bilevel Positive Airway Pressure (BiPAP) devices, and Variable Positive Airway Pressure (VPAP) devices and accessories require a prescription and are therefore not permitted. Over the counter (OTC) versions of these devices and accessories are permitted.</div><div>Products That Are Unauthorized by Health Canada</div><div>Radio Equipment or Other Devices That Violate the Radiocommunication Act</div><div>Recalled Items</div><div>Restricted Food Products</div><div>- Including, but not limited to:</div><div>- Unpasteurized dairy products</div><div>- Fruit or vegetable juice that hasn\'t been heat pasteurized</div><div>- Wild mushrooms</div><div>- Ackee fruit (including seeds)</div><div>- Food items that are subject to recall by the Canadian Food Inspection Agency</div><div>- Expired food items and baby formula</div><div>- Food items or baby formula that has been opened or tampered with</div><div>- Meals Ready to Eat (MREs) that have been expired for more than 3 years</div><div>- Government assistance benefits including, but not limited to:</div><div>- Special Supplemental Nutrition Program for Women, Infants, and Children (WIC)</div><div>- Supplemental foods such as infant formula and baby food</div><div>- Cash-value vouchers</div><div>- Food instruments such as vouchers, checks, electronic benefit transfer (EBT) cards, and coupons</div><div>- Note: Perishable items are permitted; however, the sale of food items is highly regulated by the federal and provincial government. When you list any food products, you’re certifying that the item may be sold and complies with all health, safety, and labelling requirements.</div><div>Stocks and Other Securities</div><div>- Including cryptocurrencies</div><div>- Including binary options</div><div>offer, sale, or trade of binary options.</div><div>Stolen Property</div><div>Tobacco and Other Nicotine Products</div><div>- Including e-cigarettes, e-juice, herbal blends, etc.</div><div>- Note: Hookahs, pipes, bongs, and vaporizers are permitted.</div><div>- Click here for more details on our tobacco product policies</div><div>Used Cosmetics</div><div>Weapons (or any mention of related items, services or activities)</div><div>- Including, but not limited to:</div><div>- Firearms</div><div>- Firearm parts and magazines</div><div>- Ammunition</div><div>- BB and pellet guns</div><div>- Replica weapons</div><div>- Tear gas</div><div>- Stun guns</div><div>- Crossbows</div><div>- Martial arts weapons</div><div>- Including Airsoft guns, parts, and ammunition</div><div>- Note: Archery and paintball equipment are permitted.</div>', 1, NULL, NULL, '2021-01-04 21:22:22', '2022-01-03 21:37:13'),
(6, 'fr', 'fas fa-ban', 'Contenu interdit', 'prohibited-content', NULL, NULL, '<div>La liste ci-dessous détaille ce qui ne peut pas être publié sur Suguffiè:</div><div><br></div><div>Adulte</div><div>- Y compris la pornographie, les photos de nus, les vidéos, les articles ou les produits érotiques</div><div>- Y compris prostitution, escorte ou services d\'accompagnement</div><div>De l\'alcool</div><div>- Y compris la livraison d\'alcool et de boissons assimilées Catégorie d\'emplois.</div><div>Articles pour bébés jugés dangereux</div><div>- Nids de bébé</div><div>- Marcheurs pour bébés</div><div>- Sièges d\'auto et sièges d\'appoint fabriqués avant le 1er janvier 2012</div><div>- Traverses inclinées (rappelées ou non)</div><div>- Lits de bébé traditionnels à abaissement</div><div>Sang, liquides organiques et parties du corps</div><div>- Y compris les organes</div><div>- Y compris la maternité de substitution, la fertilité et les demandes de donneurs (y compris le sperme)</div><div>Outils de cambriolage</div><div>Cannabis et produits à base de cannabis</div><div>- Y compris les extraits, les produits comestibles et les huiles</div><div>- Remarque: les narguilés, pipes, bangs et vaporisateurs sont autorisés.</div><div>- Cliquez ici pour plus de détails sur nos politiques sur les produits du cannabis</div><div>Services d\'adoption d\'enfants (recherche et offre)</div><div>Articles combustibles (y compris les fusées éclairantes)</div><div>- Remarque: les fusées éclairantes d\'urgence et de détresse ne sont autorisées que si elles sont conçues et destinées à des fins de signalisation.</div><div>- Remarque: aucune offre de livraison.</div><div>Articles contrefaits et distribution de matériel protégé par le droit d\'auteur</div><div>- Y compris la monnaie, les timbres et les pièces</div><div>- Y compris les livres électroniques</div><div>Listes associées COVID-19</div><div>- masques de soins de santé comprenant N95 / N100 et masques chirurgicaux</div><div>- gel hydroalcoolique</div><div>- lingettes désinfectantes</div><div>- papier toilette</div><div>- toute liste mentionnant COVID-19, coronavirus ou 2019nCoV (sauf les livres) dans le titre ou la description</div><div>Articles ou comptes numériques</div><div>- Y compris les comptes de jeu, les comptes avec des allocations pour plusieurs appareils et les copies numériques de films, de livres ou de logiciels</div><div>- Cliquez ici pour plus de détails sur nos articles numériques et notre politique de comptes</div><div>Marchandises sous embargo</div><div>Billets d\'événement</div><div>- Remarque: certains billets pour les événements communautaires sont autorisés.</div><div>- Cliquez ici pour plus de détails sur notre politique de vente de billets d\'événement</div><div>Identifiants, badges, uniformes et licences émis par le gouvernement</div><div>- Y compris le transit, l\'armée, la police, la poste, etc.</div><div>Matières dangereuses</div><div>- Y compris les produits chimiques, les produits antiparasitaires restreints, suspendus ou annulés et les feux d\'artifice</div><div>Pointeurs laser haute puissance</div><div>Documents d\'identité, dossiers financiers personnels et informations personnelles</div><div>- Sous n\'importe quelle forme, y compris les listes de diffusion</div><div>Drogues illégales et attirail de drogues (ou toute mention d\'articles ou d\'activités connexes)</div><div>- Y compris les stupéfiants, les stéroïdes, etc.</div><div>Articles et services illégaux</div><div>- Y compris tout appareil qui est principalement utile pour l\'interception secrète de communications privées</div><div>- Y compris des listes ou des produits qui promeuvent l\'utilisation d\'appareils photographiques pour voir ou enregistrer secrètement des individus à des fins sexuelles</div><div>Produits fauniques illégaux ou non autorisés</div><div>- Y compris les pièges à ours (quelle que soit leur taille)</div><div>Ivoire ou os</div><div>- Y compris les défenses de mammouth fossilisées</div><div>- Remarque: les antiquités qui contiennent 5% ou moins d\'ivoire véritable et qui ont été fabriquées avant 1900, en particulier les instruments de musique et les meubles, sont autorisées. L\'année de fabrication de l\'article ainsi qu\'une image doivent être incluses dans l\'annonce.</div><div>- Remarque: les os, y compris les dents ou les os fossilisés, provenant d\'animaux non producteurs d\'ivoire sont autorisés. L\'espèce doit être indiquée dans l\'annonce.</div><div>Des couteaux</div><div>- Remarque: les couteaux et épées de collection (non aiguisés, fantaisie / antiques) ainsi que les ustensiles de cuisine et les couverts sont autorisés.</div><div>Billets de loterie, inscriptions au concours et machines à sous à jetons</div><div>Services de massage</div><div>- Les images publicitaires doivent être limitées aux prises de vue de la tête ou aux photographies de l\'établissement (pas d\'images du corps entier)</div><div>- Remarque: les annonces publiées par un massothérapeute agréé (RMT) qui est en mesure de fournir des reçus d\'assurance pour les clients sont autorisées.</div><div>- Remarque: le massage dans le cadre d\'un forfait esthétique par une esthéticienne agréée, mais non offert seul, est autorisé.</div><div>Matériel offensant et obscène</div><div>- Y compris les artefacts et objets de collection liés aux nazis</div><div>- Remarque: ceci exclut les timbres, les lettres et les enveloppes avec le symbole nazi, la monnaie émise par le gouvernement nazi, les scripts militaires et les maquettes militaires de la Seconde Guerre mondiale historiquement exactes qui ont des symboles nazis.</div><div>Médicaments et appareils sur ordonnance</div><div>- Remarque: les appareils et accessoires à pression positive continue (CPAP), à pression positive à deux niveaux (BiPAP) et à pression positive variable (VPAP) nécessitent une prescription et ne sont donc pas autorisés. Les versions en vente libre (OTC) de ces appareils et accessoires sont autorisées.</div><div>Produits non autorisés par Santé Canada</div><div>Équipement radio ou autres appareils qui enfreignent la Loi sur la radiocommunication</div><div>Articles rappelés</div><div>Produits alimentaires restreints</div><div>- Y compris, mais sans s\'y limiter:</div><div>- Produits laitiers non pasteurisés</div><div>- Jus de fruits ou de légumes non pasteurisé à chaud</div><div>- Champignons sauvages</div><div>- Fruit Ackee (y compris les graines)</div><div>- Produits alimentaires faisant l\'objet d\'un rappel par l\'Agence canadienne d\'inspection des aliments</div><div>- Produits alimentaires et préparations pour nourrissons périmés</div><div>- Les aliments ou les préparations pour nourrissons qui ont été ouverts ou altérés</div><div>- Repas prêts à manger (MRE) périmés depuis plus de 3 ans</div><div>- Prestations d\'aide gouvernementale comprenant, mais sans s\'y limiter:</div><div>- Programme spécial de nutrition supplémentaire pour les femmes, les nourrissons et les enfants (WIC)</div><div>- Aliments supplémentaires comme les préparations pour nourrissons et les aliments pour bébés</div><div>- des bons de valeur en espèces</div><div>- Instruments alimentaires tels que bons, chèques, cartes de transfert électronique de prestations (EBT) et coupons</div><div>- Remarque: les articles périssables sont autorisés; cependant, la vente de produits alimentaires est fortement réglementée par les gouvernements fédéral et provincial. Lorsque vous répertoriez des produits alimentaires, vous certifiez que l\'article peut être vendu et qu\'il est conforme à toutes les exigences en matière de santé, de sécurité et d\'étiquetage.</div><div>Actions et autres titres</div><div>- Y compris les crypto-monnaies</div><div>- Y compris les options binaires</div><div>offre, vente ou échange d\'options binaires.</div><div>Propriété volée</div><div>Tabac et autres produits à base de nicotine</div><div>- Y compris les cigarettes électroniques, les jus électroniques, les mélanges d\'herbes, etc.</div><div>- Remarque: les narguilés, pipes, bangs et vaporisateurs sont autorisés.</div><div>- Cliquez ici pour plus de détails sur nos politiques relatives aux produits du tabac</div><div>Cosmétiques d\'occasion</div><div>Armes (ou toute mention d\'articles, de services ou d\'activités connexes)</div><div>- Y compris, mais sans s\'y limiter:</div><div>- Armes à feu</div><div>- Pièces et chargeurs d\'armes à feu</div><div>- Munition</div><div>- Pistolets BB et à plomb</div><div>- Répliques d\'armes</div><div>- Gaz lacrymogène</div><div>- Pistolets paralysants</div><div>- Arbalètes</div><div>- Armes d\'arts martiaux</div><div>- Y compris les pistolets Airsoft, les pièces et les munitions</div><div>- Remarque: les équipements de tir à l\'arc et de paintball sont autorisés.</div>', 1, NULL, NULL, '2021-01-04 21:24:10', '2022-01-03 21:37:13'),
(7, 'en', 'fas fa-exclamation-triangle', 'Avoiding Scams', 'avoiding-scams', NULL, NULL, '<div>Deal locally, face-to-face —follow this one rule and avoid 99% of scam attempts.</div><div>Do not provide payment to anyone you have not met</div><div>Beware offers involving shipping.</div><div>Never wire funds (e.g. Western Union) - anyone who asks you to is a scammer.</div><div>Don\'t accept cashier/certified checks or money orders - banks cash fakes, then hold you responsible.</div><div>Never give out financial info (bank account, social security, paypal account, etc).</div><div>Do not rent or purchase sight-unseen—that amazing \"deal\" may not exist.</div><div>Refuse background/credit checks until you have met landlord/employer in person.</div>', 1, NULL, NULL, '2021-01-04 21:27:57', '2021-01-25 02:22:52'),
(8, 'fr', 'fas fa-exclamation-triangle', 'Éviter les escroqueries', 'avoiding-scams', NULL, NULL, '<div>Traitez localement, en face à face - suivez cette règle et évitez 99% des tentatives d\'escroquerie.</div><div>Ne payez aucune personne que vous n\'avez pas rencontrée</div><div>Méfiez-vous des offres d\'expédition.</div><div>Ne transférez jamais de fonds (par exemple, Western Union) - quiconque vous le demande est un escroc.</div><div>N\'acceptez pas les chèques de banque / certifiés ou les mandats - les banques encaissent des faux, alors vous tenez pour responsable.</div><div>Ne communiquez jamais d\'informations financières (compte bancaire, sécurité sociale, compte paypal, etc.).</div><div>Ne louez pas et n\'achetez pas à l\'improviste - cette «offre» étonnante peut ne pas exister.</div><div>Refusez les vérifications d\'antécédents / de crédit jusqu\'à ce que vous ayez rencontré le propriétaire / l\'employeur en personne.</div>', 1, NULL, NULL, '2021-01-04 21:29:09', '2021-01-25 02:22:52'),
(9, 'en', 'fas fa-info-circle', 'Career', 'career', NULL, NULL, 'Career<br>', 1, NULL, NULL, '2021-01-25 02:15:45', '2022-01-03 21:43:52'),
(10, 'en', 'fas fa-envelope', 'Contact us', 'nous-contacter', NULL, NULL, '<br>', 0, NULL, NULL, '2021-01-29 23:19:51', '2022-01-03 21:49:33'),
(11, 'en', 'fas fa-mobile-alt', 'Mobile App', 'mobile-app', 'Install Mobile App', NULL, 'Go to your browser settings and add / install app.<div>Safari for iOS <i class=\"material-icons\">ios_share</i> and chrome <i class=\"fas fa-ellipsis-v\"></i> is better for Android&nbsp;</div>', 1, NULL, NULL, '2021-02-03 13:55:51', '2021-03-05 17:27:05'),
(12, 'fr', 'fas fa-mobile-alt', 'Application mobile', 'mobile-app', 'Installer l\'application mobile', NULL, 'Accédez aux paramètres de votre navigateur et ajoutez / installez l\'application.&nbsp;<div>Safari pour iOS <i class=\"material-icons\">ios_share</i> et Chrome  <i class=\"fas fa-ellipsis-v\"></i> est meilleur pour Android</div>', 1, NULL, NULL, '2021-02-03 13:57:50', '2021-03-05 17:27:05'),
(13, 'en', 'fas fa-info-circle', 'About us', 'about-us', NULL, NULL, '<div>Suguffiè (marketplace in Bambara) is World’s largest classifieds site with millions of live ads in a wide range of categories - cars, housing, jobs and everything in between. Two new ads are posted every second! We’re proud to provide a platform that connects the world, helping them to buy great items in their community, make money off unused possessions cluttering up houses, and help the country waste less.</div><div><br></div><div>the idea was to offer the world a fun and easy way for people in the same area to buy, sell, trade, and even help each other with goods, cars, services, housing, or jobs. That hasn’t changed and now lot of communities are doing more for less.&nbsp;</div><div><br></div><div>Suguffiè is an environmentally friendly and local way to recycle things. Plus, because Suguffiè connections are between people who live near each other, you can always see, touch, and try an item before you buy it.</div><div><br></div><div>Get in touch</div><div>If there is something you would like to see on Suguffiè? Or maybe your community isn’t listed on Suguffiè? Perhaps, you need some support from our customer service team. If so, reach out</div><a target=\"_blank\" href=\"mailto:contact@suguffie.com\" style=\"color:white\"><i class=\"fas fa-envelope fa-5x\"></i></a>', 1, NULL, NULL, '2021-06-15 21:37:57', '2021-06-15 22:31:24'),
(14, 'fr', 'fas fa-info-circle', 'Carrière', 'career', NULL, NULL, 'Carrière<br>', 1, NULL, NULL, '2022-01-03 21:42:00', '2022-01-03 21:43:52');
